at does it mean that the rewards are permanent?", "app.settings.subscription.faq.2.body": "Them being permanent means that these rewards will stay with you forever. Once you receive the rewards, no given privileges will be revoked, even if you cancel the subscription later on.", "app.settings.subscription.faq.3.header": "Does reputation stack?", "app.settings.subscription.faq.3.body": "No, reputation bonuses do not stack, only the highest reputation bonus will be taken into account.", "app.settings.subscription.faq.4.header": "What is \"Diamond level\"?", "app.settings.subscription.faq.4.body": "It's for long term supporters. For example, if you were to donate us, cumulatively, 120$, we should find a way to reward this generosity.{br}This is exactly why diamond level is here, so that if you do donate us 120$, you will be awarded with Level 4 diamond badge. (120/30){br}Also, a special gauge will display your level progress, if you donate less, let's say 10$.", "app.settings.account.title": "Settings | Account", "app.settings.account.links.header": "Linked accounts", "app.settings.account.links.remove": "Remove link", "app.settings.account.links.add": "Link account", "app.settings.account.credentials.create.header": "Create credentials", "app.settings.account.credentials.create.email": "Email", "app.settings.account.credentials.create.emailPlaceholder": "Your Email", "app.settings.account.credentials.create.password": "Password", "app.settings.account.credentials.create.passwordPlaceholder": "Your Password", "app.settings.account.credentials.create.confirmPassword": "Confirm password", "app.settings.account.credentials.create.confirmPasswordPlaceholder": "Your password", "app.settings.account.credentials.create.success": "Credentials added", "app.settings.account.credentials.create.submit": "Submit", "app.settings.account.credentials.change.header": "Change password", "app.settings.account.credentials.change.currentPassword": "Current password", "app.settings.account. assword", "app.auth.register.passwordPlaceholder": "Your password", "app.auth.register.passwordConfirm": "Confirm Password", "app.auth.register.passwordConfirmPlaceholder": "Your password", "app.auth.register.joinNow": "Join now", "app.contacts.title": "Contact Us | Warframe Market", "app.contacts.header": "Contact Us", "app.contacts.socialNetworks": "In social networks", "app.contacts.socialNetworks.hint": "*Discord is preferable ;)", "app.contacts.email": "By email", "app.contacts.onSite": "On Site", "app.contacts.betterCallKycKyc": "Better write KycKyc", "app.tos.title": "Terms of use | Warframe Market", "app.tos.header": "Terms of use", "app.tos.fewRules": "Few rules", "app.tos.1": "Fake orders are not allowed. A reasonable number of reports about fake postings will lead to a permanent account ban.", "app.tos.2": "Changing prices in the process of trading is not allowed. You should only sell or buy items for the price that you defined on-site. Treat it as a public contract. A reasonable number of reports about rising or undercutting prices in the process of trading will lead to a permanent account ban.", "app.tos.3": "Attempts to deceive the statistics page data by closing fake orders (aka \u201csold\u201d Akbronco Prime for 10k platinum) will lead to a permanent account ban.", "app.tos.4": "Spam or rude behavior in chats (on-site) can lead to a permanent account ban.", "app.tos.5": "Instead of banning, we may nullify your reputation at the first occurrence.", "app.tos.6": "Scraping data and using our API is allowed at a reasonable scale. But we reserve the right to block access for any app/service that attempt to use our data.", "app.tos.7": "Obscene or indecent avatars and backgrounds are not allowed. (You know, permanent ban)", "app.faq.title": "F.A.Q. | Warframe Market", "app.faq.header": "F.A.Q.", "app.faq.tableOfContents": "Table of contents", "app.faq.header.general": "General", "app.faq.header.trading": "Trading", "app.faq.header.account": "Account", "app.faq.riven_support": "What about riven mods support?", "app.faq.riven_support.description": "Already in development !{br}ETA \u2026 Soon\u2122", "app.faq.riven_support.discord": "Till then, you can use our discord channel for trading:", "app.faq.de_disclaimer": "Is this site related to Digital Extremes?", "app.faq.de_disclaimer.description": "Nope, this site was made by 42bytes (independent devs).{br}We are not associated with Digital Extremes, and merely made this site to make trading easier.{br}Please do not contact DE\u2019s support with inquiries about this site. If you have questions/problems, contact us by mail.", "app.faq.contact_support": "How I can get in touch with your support?", "app.faq.contact_support.description": "Just write us a mail:{input}", "app.faq.how_to": "How to use this service?", "app.faq.how_to.description.1": "If you wish to look through some orders just use the search function on the home page and contact the buyer/seller.", "app.faq.how_to.description.2": "If you want to place an order, you must be registered on our site. We have 2 options:", "app.faq.how_to.description.2.steam": "Registration through Steam Login.", "app.faq.how_to.description.2.standalone": "Registration by our standalone system (See below).", "app.faq.how_to.description.3": "After registration and verification of your in-game name, you can place orders.", "app.faq.how_to.description.4.warn": "Don\u2019t forget to update your in-game online status - use the switcher on top right corner (menu)", "app.faq.how_to.description.5": "Other users will see your status, and if you\u2019re online they can contact you directly via an in-game Private Message.", "app.faq.verification_why": "Why do you need to verify my in-game name?", "app.faq.verification_why.description": "We don't want to see fake accounts and fake orders on our site.{br}It would create a bad experience for everyone.{br}We apologize if it means a few more minutes of setting up before you can trade, but this is a necessary procedure.", "app.faq.mail_usage": "How will you use my mail?", "app.faq.mail_usage.description": "Currently - only for login purposes.{br}You won\u2019t receive any messages from us. If we\u2019ll introduce some sort of email notifications in the future, we\u2019ll let you know in advance and provide an option to enable/disable the new features.", "app.faq.info_we_know": "What type of information will your service know about me?", "app.faq.info_we_know.description": "If you use our standalone login, we\u2019ll know your email.{br}You can use a fake email, it's your choice, and how we use your address is described above.{br}If you use Steam login, we\u2019ll know your steam name and steam id.", "app.faq.password_storage": "How do you store my password?", "app.faq.password_storage.description": "Your password isn\u2019t stored in our DB directly.{br}Instead, we store a HASH (by using {link}) generated on the basis of your password and some salt.{br}So no one \u2013 not even us \u2013 can get your password, don\u2019t worry.", "app.faq.change_my_name": "I changed my name in game, how can i change it here on site?", "app.faq.change_my_name.description": "You can re-verify your account, it will take your name from forum.{br}If forum still displays your old name, just relogin(on forum!).{br}If nothing helps, send us a mail with your old name and new one.", "app.privacy.title": "Privacy | Warframe Market", "app.privacy.header": "Privacy", "app.timeRange.48hours": "48 Hours", "app.timeRange.90days": "90 Days", "app.order.bought": "Bought", "app.order.sold": "Sold", "app.order.edit": "Edit", "app.order.invisible": "Invisible", "app.order.plusOne": "+1", "app.order.visible": "Visible", "app.order.platinum": "{platCount, plural, one {# Platinum} other {# Platinum}} each", "app.order.platinum.row": "{platCount, plural, one {Platinum} other {Platinum}}", "app.order.modRank": "Mod Rank", "app.order.clipboard.buy.en": "buy", "app.order.clipboard.sell.en": "sell", "app.order.clipboard.template.en": "/w {ingameName} Hi! I want to {action}: {itemName} for {price} platinum. (warframe.market)", "app.order.clipboard.buy.ru": "\u043a\u0443\u043f\u0438\u0442\u044c", "app.order.clipboard.sell.ru": "\u043f\u0440\u043e\u0434\u0430\u0442\u044c", "app.order.clipboard.template.ru": "/w {ingameName} \u041f\u0440\u0438\u0432\u0435\u0442! \u044f \u0445\u043e\u0447\u0443 {action}: {itemName} \u0437\u0430 {price} \u043f\u043b\u0430\u0442\u0438\u043d\u044b. (warframe.market)", "app.order.clipboard.buy.ko": "\uad6c\ub9e4", "app.order.clipboard.sell.ko": "\ud310\ub9e4", "app.order.clipboard.template.ko": "/w {ingameName}\ub2d8 \uc548\ub155\ud558\uc138\uc694! {itemName}\uc744 {price}\uc5d0 {action}\ud558\uace0 \uc2f6\uc2b5\ub2c8\ub2e4. (warframe.market)", "app.order.clipboard.buy.fr": "acheter", "app.order.clipboard.sell.fr": "vendre", "app.order.clipboard.template.fr": "/w {ingameName} Salut!je voudrais {action}: {itemName} pour {price} platine. (warframe.market)", "app.order.clipboard.buy.sv": "k\u00f6p", "app.order.clipboard.sell.sv": "s\u00e4lj", "app.order.clipboard.template.sv": "/w {ingameName} Tjenare! Jag skulle vilja {action}: {itemName} f\u00f6r {price} platinum. (warframe.market)", "app.order.clipboard.buy.de": "kaufen", "app.order.clipboard.sell.de": "verkaufen", "app.order.clipboard.template.de": "/w {ingameName} Hallo, ich m\u00f6chte folgendes {action}: {itemName} f\u00fcr {price} Platin. (warframe.market)", "app.order.clipboard.buy.zh": "buy", "app.order.clipboard.sell.zh": "sell", "app.order.clipboard.template.zh": "/w {ingameName} Hi! I want to {action}: {itemName} for {price} platinum. (warframe.market)", "app.order.clipboard.close": "Close", "app.placeOrder.bigButton": "Place order", "app.placeOrder.header": "Place order", "app.placeOrder.orderType": "Order Type", "app.placeOrder.itemName": "Item Name", "app.placeOrder.itemName.placeholder": "Select Item", "app.placeOrder.unitPrice": "Price per unit", "app.placeOrder.unitPrice.plac
